import React, { Component } from 'react'

import "./Home.css";
import Card from "../Components/Card";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        {/* Hero Component */}
        <div className="heroSection">

          <div className="hero-content">

            <div className="hero-title">
              Bring Idea to Real
          </div>

            <h2>
              Full-stack product designer with front-end
              skills, HTML, CSS, JavaScript, and React. He executes product designs
              from the discovery phases (competitive analysis, user study, A/B
              testing, prototyping) to the implementation phase (interaction design,
              high-fi mocks).
          </h2>
            {/* <button>Contact</button> */}
          </div>

        </div>

        {/* Projects Section */}
        <div className="cardSection">
          <Card
            projectName="Cash on Delivery"
            intro="One of Wish's SEA Initiative projects, generated more GMV and improved unique buyer conversion rate in SEA."
          />

          <Card
            projectName="Project 1"
            intro="Intro"
          />

          <Card
            projectName="Project 2"
            intro="Intro"
          />
        </div>

        {/* Open Design Section/ Cards */}

        {/* Footer */}

      </div>
    );
  }
}

export default Home;
